function copyToClipboard(n){let t=document.createElement("input");t.value=n;document.body.appendChild(t);t.select();t.setSelectionRange(0,99999);document.execCommand("copy");t.parentNode.removeChild(t)}(function(){document.addEventListener("mousedown",function(n){if(n.target){let t=n.target.closestClass("nav-control");if(t){let t=n.target.closestAttribute("data-action");switch(t.dataset.action){case"copy":copyToClipboard(t.dataset.value);createSnackbar(t.dataset.message)}}}})})();